syntax = "proto3";

package lunarclient.websocket.skyblock.v1;

import "lunarclient/common/v1/uuid.proto";
import "lunarclient/websocket/skyblock/v1/common.proto";

option java_package = "com.lunarclient.websocket.skyblock.v1";
option java_outer_classname = "PushProto";
option java_multiple_files = true;

message DungeonUpdatePush {
  lunarclient.common.v1.Uuid sender_uuid = 1;
  lunarclient.websocket.skyblock.v1.DungeonUpdate update = 2;
}



